import React, { useState } from 'react';
import './chat.css';


const Chat = () => {

  const [isModalOpen, setModalOpen] = useState(false);

  const openModal = () => {
    setModalOpen(true);
  };

  const closeModal = () => {
    setModalOpen(false);
  };

  return (
    <div>

    <nav className="navbar">
      

        <input placeholder='Search by username' className='searchInput' />
      
        <button className='addFriends' onClick={openModal}>+</button>

    </nav>
    
    <div className='usersBox'>
  
    </div>
      {isModalOpen && (
          <div className="modal-overlay">
            <div className="modal">
              <button className="close-button" onClick={closeModal}>x</button>
              <h2></h2>
              <p></p>
            </div>
          </div>
        )}


    </div>
  );
}



export default Chat;
